import "./App.css";
import Footer from "./footer.js";
import Header from "./header.js";
import Panel from "./panel.js";
import Arows from "./arows.js";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <>
      <Arows />
      <Header />
      <Routes>
        <Panel />
      </Routes>

      <Footer />
    </>
  );
}

export default App;
